#
# TABLE STRUCTURE FOR: apartments
#

DROP TABLE IF EXISTS `apartments`;

CREATE TABLE `apartments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_guests_number` int(10) unsigned NOT NULL,
  `types` enum('private room','entire home') COLLATE utf8_unicode_ci NOT NULL,
  `body` text COLLATE utf8_unicode_ci NOT NULL,
  `photo_id` int(10) unsigned NOT NULL,
  `city_id` varchar(130) COLLATE utf8_unicode_ci DEFAULT NULL,
  `prix` double NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Apartments';



